import React from "react";
import "./Head.css";
import { HiGlobeEuropeAfrica } from "react-icons/hi2";
import { ImCtrl } from "react-icons/im";
import "animate.css";
const Head = () => {
  return (
    <section className="wrapper">
      {/*Left section*/}
      <div className="h-left">
        <HiGlobeEuropeAfrica size={25} />
        <select className="select animate__animated animate__rotateIn">
          <option>Telugu</option>
          <option>English</option>
          <option>Hindi</option>
          <option>Tamil</option>
        </select>
      </div>
      {/*Right Section*/}
      <div className="h-right"></div>
    </section>
  );
};
export default Head;
